import { useEffect, useState } from "react";

import faker from "faker";

import { generateData } from "../../services/random-data-generator";

import "./App.css";

function App() {
  const [tableData, setTableData] = useState([]);

  useEffect(() => {
    const fetchData = async () => {
      try {
        const demoData = generateData(30); // Generate 10 entries

        console.log(demoData);

        setTableData(demoData);
      } catch (err) {
        console.log(err);
      }
    };

    fetchData();
  }, []);

  return (
    <div className="App">
      <header className="App-header">TEST TABLE</header>
      <section>{tableData}</section>
    </div>
  );
}

export default App;
